func isAdditiveNumber(_ num: String) -> Bool {
    var ans = false
    func backtrack(_ idx: Int, _ path: [Int]) {
        if idx == num.count {
            if path.count >= 3 {
                var add = true
                for i in 2..<path.count {
                    if path[i] != path[i-1] + path[i-2] {
                        add = false
                        break
                    }
                }
                if add {
                    ans = true
                }
            }
            return
        }
        for i in idx...num.count-1 {
            let cur = String(num[num.index(num.startIndex, offsetBy: idx)...num.index(num.startIndex, offsetBy: i+1)])
            if cur.count > 1 && cur.first == "0" {
                continue
            }
            if let n = Int(cur) {
                backtrack(i+1, path + [n])
            }
        }
    }
    backtrack(0, [])
    return ans
}

func isAdditiveNumber(_ num: String) -> Bool {
    func isValid(_ num: String) -> Bool {
        return num.count == 1 || num.first != "0"
    }
    func backtrack(_ idx: Int, _ path: [Int]) -> Bool {
        if idx == num.count {
            return path.count >= 3
        }
        for i in idx...num.count-1 {
            let cur = String(num[num.index(num.startIndex, offsetBy: idx)...num.index(num.startIndex, offsetBy: i+1)])
            if !isValid(cur) {
                continue
            }
            if let n = Int(cur) {
                if path.count < 2 || n == path[path.count-1] + path[path.count-2] {
                    if backtrack(i+1, path + [n]) {
                        return true
                    }
                }
            }
        }
        return false
    }
    return backtrack(0, [])
}

func allPathsSourceTarget(_ graph: [[Int]]) -> [[Int]] {
    let n = graph.count
    var result: [[Int]] = []
    func dfs(_ node: Int, _ path: [Int]) {
        if node == n - 1 {
            result.append(path)
            return
        }
        for nextNode in graph[node] {
            dfs(nextNode, path + [nextNode])
        }
    }
    dfs(0, [0])
    return result
}

func allPathsSourceTarget(_ graph: [[Int]]) -> [[Int]] {
    let n = graph.count
    var result: [[Int]] = []
    var memo: [Int: [[Int]]] = [:]
    func dfs(_ node: Int, _ path: [Int]) -> [[Int]] {
        if let cachedResult = memo[node] {
            return cachedResult
        }
        if node == n - 1 {
            return [path]
        }
        var paths: [[Int]] = []
        for nextNode in graph[node] {
            let newPaths = dfs(nextNode, path + [nextNode])
            paths.append(contentsOf: newPaths)
        }
        memo[node] = paths
        return paths
    }
    result = dfs(0, [0])
    return result
}

