class Solution {
    func ambiguousCoordinates(_ s: String) -> [String] {
        var res: [String] = []
        let nums = Array(s.dropFirst().dropLast())
        for i in 1...nums.count-1 {
            let left = String(nums.prefix(i))
            let right = String(nums.suffix(nums.count-i))
            for l in possibleInterpretations(left) {
                for r in possibleInterpretations(right) {
                    res.append("(\(l), \(r))")
                }
            }
        }
        return res
    }

    func possibleInterpretations(_ nums: String) -> [String] {
        var res: [String] = []
        if nums.first == "0" && nums.count > 1 {
            return ["0"]
        }
        if nums.count == 1 {
            return [nums]
        }
        for i in 1...nums.count-1 {
            let left = String(nums.prefix(i))
            let right = String(nums.suffix(nums.count-i))
            res.append(left + "." + right)
        }
        res.append(nums)
        return res
    }
}

func ambiguousCoordinates(s: String) -> [String] {
    var res: [String] = []
    let nums = Array(s.dropFirst().dropLast())
    let memo: [Substring: [String]] = [:]
    for i in 1...nums.count-1 {
        let left = nums.prefix(i)
        let right = nums.suffix(nums.count-i)
        let lOptions = memo[left] ?? possibleInterpretations(left)
        let rOptions = memo[right] ?? possibleInterpretations(right)
        for l in lOptions {
            for r in rOptions {
                res.append("((l), (r))")
            }
        }
    }
    return res
}

func possibleInterpretations(_ nums: Substring) -> [String] {
    var res: [String] = []
    if nums.first == "0" && nums.count > 1 {
        return ["0"]
    }
    if nums.count == 1 {
        return [String(nums)]
    }
    for i in 1...nums.count-1 {
        let left = nums.prefix(i)
        let right = nums.suffix(nums.count-i)
        res.append(String(left) + "." + String(right))
    }
    res.append(String(nums))
    return res
}

class Solution {
    func binaryTreePaths(_ root: TreeNode?) -> [String] {
        var result = [String]()
        dfs(root, [], &result)
        return result
    }

    func dfs(_ node: TreeNode?, _ path: [Int], _ result: inout [String]) {
        guard let node = node else { return }
        var path = path + [node.val]
        if node.left == nil && node.right == nil {
            result.append(path.map { String($0) }.joined(separator: "->"))
        } else {
            dfs(node.left, path, &result)
            dfs(node.right, path, &result)
        }
    }
}

class Solution {
    func binaryTreePaths(_ root: TreeNode?) -> [String] {
        var result = [String]()
        var stack = [(node: TreeNode, path: String)]()
        if let root = root {
            stack.append((root, String(root.val)))
        }
        while !stack.isEmpty {
            let (node, path) = stack.popLast()!
            if node.left == nil && node.right == nil {
                result.append(path)
            } else {
                if let left = node.left {
                    stack.append((left, path + "->" + String(left.val)))
                }
                if let right = node.right {
                    stack.append((right, path + "->" + String(right.val)))
                }
            }
        }
        return result
    }
}

