func readBinaryWatch(_ turnedOn: Int) -> [String] {
    var res = [String]()
    let hours = [1, 2, 4, 8]
    let minutes = [1, 2, 4, 8, 16, 32]
    var hourPowers = [Int]()
    var minutePowers = [Int]()
    for i in 0...3 {
        hourPowers.append(hours[i])
        minutePowers.append(minutes[i])
    }
    for h in hourPowers {
        for m in minutePowers {
            if ((h.nonzeroBitCount) + (m.nonzeroBitCount)) == turnedOn {
                let time = String(format: "%02d:%02d", h, m)
                res.append(time)
            }
        }
    }
    return res
}

func combinationSum(_ candidates: [Int], _ target: Int) -> [[Int]] {
    var result: [[Int]] = []
    var current: [Int] = []

    func backtrack(_ index: Int, _ remaining: Int) {
        if remaining == 0 {
            result.append(current)
            return
        }
        if remaining < 0 { return }

        for i in index..<candidates.count {
            current.append(candidates[i])
            backtrack(i, remaining - candidates[i])  // same i for reuse
            current.removeLast()
        }
    }

    backtrack(0, target)
    return result
}

func combinationSum2(_ candidates: [Int], _ target: Int) -> [[Int]] {
    var result: [[Int]] = []
    var current: [Int] = []
    let sorted = candidates.sorted()

    func backtrack(_ start: Int, _ remaining: Int) {
        if remaining == 0 {
            result.append(current)
            return
        }
        for i in start..<sorted.count {
            if sorted[i] > remaining { break }
            if i > start && sorted[i] == sorted[i-1] { continue }
            current.append(sorted[i])
            backtrack(i + 1, remaining - sorted[i])
            current.removeLast()
        }
    }

    backtrack(0, target)
    return result
}

func combinationSum3(_ k: Int, _ n: Int) -> [[Int]] {
    var result = [[Int]]()
    var currentCombination = [Int]()
    combinationSum3Helper(&result, &currentCombination, k, n, 1)
    return result
}

func combinationSum3Helper(_ result: inout [[Int]], _ currentCombination: inout [Int], _ k: Int, _ n: Int, _ start: Int) {
    if currentCombination.count == k {
        if currentCombination.reduce(0, +) == n {
            result.append(currentCombination)
        }
        return
    }

    for i in start...9 {
        currentCombination.append(i)
        combinationSum3Helper(&result, &currentCombination, k, n, i + 1)
        currentCombination.removeLast()
    }
}

func combinationSum3(_ k: Int, _ n: Int) -> [[Int]] {
    var result = [[Int]]()
