func combinationSum3Helper(_ result: inout [[Int]], _ currentCombination: inout [Int], _ k: Int, _ n: Int, _ start: Int, _ currentSum: Int) {
    if currentCombination.count == k {
        if currentSum == n {
            result.append(currentCombination)
        }
        return
    }

    for i in start...9 {
        if currentSum + i <= n {
            currentCombination.append(i)
            combinationSum3Helper(&result, &currentCombination, k, n, i + 1, currentSum + i)
            currentCombination.removeLast()
        } else {
            break
        }
    }
}

func combine(_ n: Int, _ k: Int) -> [[Int]] {
    var result: [[Int]] = []
    var combo: [Int] = []
    func backtrack(_ start: Int) {
        if combo.count == k { result.append(combo); return }
        for i in start...n {
            combo.append(i)
            backtrack(i + 1)
            combo.removeLast()
        }
    }
    backtrack(1)
    return result
}

func generateParenthesis(_ n: Int) -> [String] {
    var result: [String] = []
    var current = ""

    func backtrack(_ open: Int, _ close: Int) {
        if current.count == 2 * n {
            result.append(current)
            return
        }
        if open < n {
            current.append("(")
            backtrack(open + 1, close)
            current.removeLast()
        }
        if close < open {
            current.append(")")
            backtrack(open, close + 1)
            current.removeLast()
        }
    }

    backtrack(0, 0)
    return result
}

func largestTimeFromDigits(A: [Int]) -> String {
    var A = A
    var maxTime = -1
    var time = ""
    permute(A, 0, &time, &maxTime)
    if maxTime == -1 { return "" }
    return String(format: "%02d:%02d", maxTime / 60, maxTime % 60)
}

func permute(_ A: [Int], _ start: Int, _ time: inout String, _ maxTime: inout Int) {
    var A = A
    if start == A.count {
        if isValid(A) && timeToInt(A) > maxTime {
            maxTime = timeToInt(A)
        }
    } else {
        for i in start..<A.count {
            swap(&A, start, i)
            permute(A, start + 1, &time, &maxTime)
            swap(&A, start, i)
        }
    }
}

func swap(_ A: inout [Int], _ i: Int, _ j: Int) {
    var A = A
    let temp = A[i]
    A[i] = A[j]
    A[j] = temp
}

func isValid(_ A: [Int]) -> Bool {
    var A = A
    if A[0] * 10 + A[1] > 23 || A[2] * 10 + A[3] > 59 {
        return false
    }
    return true
}

func timeToInt(_ A: [Int]) -> Int {
    var A = A
    return (A[0] * 10 + A[1]) * 60 + A[2] * 10 + A[3]
}

func largestTimeFromDigits(A: [Int]) -> String {
    let sortedA = A.sorted() { $0 > $1 }
    for h1 in 0..<4 {
        for h2 in 0..<4 {
            if h1 == h2 { continue }
            for m1 in 0..<4 {
                if m1 == h1 || m1 == h2 { continue }
                for m2 in 0..<4 {
                    if m2 == h1 || m2 == h2 || m2 == m1 { continue }
                    let hours = sortedA[h1] * 10 + sortedA[h2]
                    let minutes = sortedA[m1] * 10 + sortedA[m2]
                    if hours < 24 && minutes < 60 {
                        return String(format: "%02d:%02d", hours, minutes)
                    }
                }
            }
        }
    }
    return ""
}

import Foundation

func letterCasePermutation(_ s: String) -> [String] {
    var result: [String] = []
    backtrack(String(s), 0, &result)
    return result
}

func backtrack(_ s: String, _ index: Int, _ result: inout [String]) {
    if index == s.count {
        result.append(s)
        return
    }
    let currentChar = s[s.index(s.startIndex, offsetBy: index)]
    if currentChar.isLetter {
        let upper = String(currentChar).uppercased()
        let lower = String(currentChar).lowercased()
        var copy = s
        copy.replaceSubrange(s.index(s.startIndex, offsetBy: index)...s.index(s.startIndex, offsetBy: index), with: upper)
        backtrack(copy, index + 1, &result)
        copy.replaceSubrange(s.index(s.startIndex, offsetBy: index)...s.index(s.startIndex, offsetBy: index), with: lower)
        backtrack(copy, index + 1, &result)
    } else {
        backtrack(s, index + 1, &result)
    }
}

