func letterCasePermutation(_ s: String) -> [String] {
    let n = s.count
    let numBits = s.reduce(0) { $0 + ($1.isLetter ? 1 : 0) }
    var result: [String] = []
    for i in 0..<1<<numBits {
        var copy = s
        var index = 0
        for (j, char) in s.enumerated() {
            if char.isLetter {
                if (i>>index)&1 == 1 {
                    copy.replaceSubrange(s.index(s.startIndex, offsetBy: j)...s.index(s.startIndex, offsetBy: j), with: String(char).uppercased())
                } else {
                    copy.replaceSubrange(s.index(s.startIndex, offsetBy: j)...s.index(s.startIndex, offsetBy: j), with: String(char).lowercased())
                }
                index += 1
            }
        }
        result.append(copy)
    }
    return result
}

func letterCombinations(_ digits: String) -> [String] {
    guard !digits.isEmpty else { return [] }

    let map: [Character: String] = [
        "2": "abc", "3": "def", "4": "ghi", "5": "jkl",
        "6": "mno", "7": "pqrs", "8": "tuv", "9": "wxyz"
    ]
    let digitsArray = Array(digits)
    var result: [String] = []
    var current = ""

    func backtrack(_ index: Int) {
        if index == digitsArray.count {
            result.append(current)
            return
        }
        let letters = map[digitsArray[index]]!
        for letter in letters {
            current.append(letter)
            backtrack(index + 1)
            current.removeLast()
        }
    }

    backtrack(0)
    return result
}

func solveNQueens(_ n: Int) -> [[String]] {
    var result: [[String]] = []
    var board = [[Character]](repeating: [Character](repeating: ".", count: n), count: n)
    var cols = Set<Int>()
    var diags = Set<Int>()  // row - col
    var antiDiags = Set<Int>()  // row + col

    func backtrack(_ row: Int) {
        if row == n {
            result.append(board.map { String($0) })
            return
        }
        for col in 0..<n {
            let diag = row - col, antiDiag = row + col
            if cols.contains(col) || diags.contains(diag) || antiDiags.contains(antiDiag) {
                continue
            }
            board[row][col] = "Q"
            cols.insert(col); diags.insert(diag); antiDiags.insert(antiDiag)
            backtrack(row + 1)
            board[row][col] = "."
            cols.remove(col); diags.remove(diag); antiDiags.remove(antiDiag)
        }
    }

    backtrack(0)
    return result
}

