func permute(_ nums: [Int]) -> [[Int]] {
    var result: [[Int]] = []
    var current: [Int] = []
    var used = [Bool](repeating: false, count: nums.count)

    func backtrack() {
        if current.count == nums.count {
            result.append(current)
            return
        }
        for i in 0..<nums.count {
            if used[i] { continue }
            used[i] = true
            current.append(nums[i])
            backtrack()
            current.removeLast()
            used[i] = false
        }
    }

    backtrack()
    return result
}

func permuteUnique(_ nums: [Int]) -> [[Int]] {
    let sorted = nums.sorted()
    var result: [[Int]] = []
    var perm: [Int] = []
    var used = [Bool](repeating: false, count: nums.count)
    func backtrack() {
        if perm.count == sorted.count { result.append(perm); return }
        for i in 0..<sorted.count {
            if used[i] { continue }
            if i > 0 && sorted[i] == sorted[i-1] && !used[i-1] { continue }
            used[i] = true; perm.append(sorted[i])
            backtrack()
            perm.removeLast(); used[i] = false
        }
    }
    backtrack()
    return result
}

func pyramidTransition(_ bottom: String, _ allowed: [String]) -> [String] {
    var result: [String] = []
    let chars: [Character] = Array<Character>(bottom)

    func backtrack(_ index: Int, _ current: String) {
        if index == chars.count - 1 {
            result.append(current)
            return
        }
        for str in allowed {
            let strStart = str.index(str.startIndex, offsetBy: 0)
            let strEnd = str.index(strStart, offsetBy: 1)
            let pair = String(chars[index]) + String(chars[index + 1])
            if String(str[strStart...strEnd]) == pair {
                let newStr = current + String(str.last!)
                backtrack(index + 1, newStr)
            }
        }
    }
    backtrack(0, String())
    return result
}

class Solution {
    func pyramidTransition(_ bottom: String, _ allowed: [String]) -> [String] {
        var transitions: [String: [Character]] = [:]
        for str in allowed {
            let
            key = str.substring(to: str.index(str.startIndex, offsetBy: 2))
            transitions[key] = Array<Character>(str.suffix(1))
        }
        var result: [String] = []
        let chars: [Character] = Array<Character>(bottom)
        func backtrack(_ index: Int, _ current: String) {
            if index == chars.count - 1 {
                result.append(current)
                return
            }
            if
            let
            validTransitions = transitions[String(chars[index]) + String(chars[index + 1])] {
                for transition in validTransitions {
                    let
                    newStr = current + String(transition)
                    backtrack(index + 1, newStr)
                }
            }
        }
        backtrack(0, String())
        return result
    }
}

