        }
        for i in 1...3 {
            if start + i <= n {
                let segment = String(s.startIndex..., offsetBy: start + i - start)
                if Int(segment) ?? 0 <= 255 && (segment.first == "0" ? segment.count == 1 : true) {
                    backtrack(String(s.startIndex..., offsetBy: start + i), path + [segment], start + i)
                }
            }
        }
    }
    backtrack(s, [], 0)
    return res
}
