    func isValid(_ segment: String) -> Bool {
        if segment.first == "0" && segment.count > 1 {
            return false
        }
        return Int(segment) ?? 0 <= 255
    }
    for i in 1...3 {
        for j in i+1...i+3 {
            for k in j+1...j+3 {
                if k <= n - 1 {
                    let
                    a = String(s.startIndex..., offsetBy: i)
                    let
                    b = String(s.index(s.startIndex, offsetBy: i)..., offsetBy: j - i)
                    let
                    c = String(s.index(s.startIndex, offsetBy: j)..., offsetBy: k - j)
                    let
                    d = String(s.index(s.startIndex, offsetBy: k)...)
                    if isValid(a) && isValid(b) && isValid(c) && isValid(d) {
                        res.append("(a).(b).(c).(d)")
                    }
                }
            }
        }
    }
    return res
}
