public class TreeNode {
    public var val: Int
    public var label: String
    public var left: TreeNode?
    public var right: TreeNode?

    public init(_ val: Int, _ label: String) {
        self.val = val
        self.label = label
        self.left = nil
        self.right = nil
    }
}

class Solution {
    func smallestFromLeaf(_ root: TreeNode?) -> String {
        var smallest: String = "#"

        var path: [String] = []

        smallestFromLeaf(root, &path, &smallest)

        return smallest
    }

    func smallestFromLeaf(_ node: TreeNode?, _ path: inout [String], _ smallest: inout String) {
        guard let node = node else { return }
        path.append(node.label)
        if node.left == nil && node.right == nil {
            let current: String = path.reversed().joined()
            if smallest == "#" || current < smallest {
                smallest = current
            }
        }
        smallestFromLeaf(node.left, &path, &smallest)
        smallestFromLeaf(node.right, &path, &smallest)
        path.removeLast()
    }
}

