func splitIntoFibonacci(_ S: String) -> [Int] {
    guard S.count >= 3 else { return [] }

    func backtrack(_ path: [Int], _ i: Int) -> [[Int]] {
        guard i == S.count else {
            var result: [[Int]] = []
            for len in 1...10 {
                if i + len > S.count { break }
                let substr = String(S.prefix(i + len).suffix(len))
                guard let num = Int(substr) else { continue }
                if len > 1 && substr.first == "0" { continue }
                if path.count < 2 {
                    result.append(contentsOf: backtrack(path + [num], i + len))
                } else if path[path.count - 1] + path[path.count - 2] == num {
                    if let res = backtrack(path + [num], i + len) {
                        return res
                    }
                }
            }
            return []
        }
        return [path]
    }

    return backtrack([], 0).first ?? []
}

class TrieNode {
    var children: [String: TrieNode] = [:]
    var isEnd: Bool = false
}

func splitIntoFibonacci(_ S: String) -> [Int] {
    guard S.count >= 3 else { return [] }

    func buildTrie(_ seq: [Int]) {
        var root = TrieNode()
        var node = root
        for num in seq {
            let numStr = String(num)
            if node.children[numStr] == nil {
                node.children[numStr] = TrieNode()
            }
            node = node.children[numStr]!
        }
        node.isEnd = true
    }

    func dfs(_ node: TrieNode, _ path: [Int], _ i: Int) -> [[Int]] {
        if i == S.count {
            return [[Int]]()
        }

        var result: [[Int]] = []
        for len in 1...10 {
            if i + len > S.count { break }
            let substr = String(S.prefix(i + len).suffix(len))
            guard let num = Int(substr) else { continue }
            if len > 1 && substr.first == "0" { continue }
            if let child = node.children[String(num)] {
                if path.count < 2 {
                    if let res = dfs(child, path + [num], i + len) {
                        return res
                    }
                } else if path[path.count - 1] + path[path.count - 2] == num {
                    if let res = dfs(child, path + [num], i + len) {
                        return res
                    }
                }
            }
        }
        return []
    }

    let root = TrieNode()
    buildTrie([1, 2, 3])
    return dfs(root, [], 0).first ?? []
}

func subsets(_ nums: [Int]) -> [[Int]] {
    var result: [[Int]] = []
    var current: [Int] = []

    func backtrack(_ index: Int) {
        if index == nums.count {
            result.append(current)
            return
        }
        // Include nums[index]
        current.append(nums[index])
        backtrack(index + 1)
        current.removeLast()
        // Exclude nums[index]
        backtrack(index + 1)
    }

    backtrack(0)
    return result
}

func subsetsWithDup(_ nums: [Int]) -> [[Int]] {
    var result: [[Int]] = []
    var current: [Int] = []
    let sorted = nums.sorted()

    func backtrack(_ start: Int) {
        result.append(current)
        for i in start..<sorted.count {
            // Skip duplicates at same level
            if i > start && sorted[i] == sorted[i-1] { continue }
            current.append(sorted[i])
            backtrack(i + 1)
            current.removeLast()
        }
    }

    backtrack(0)
    return result
}

func exist(_ board: [[Character]], _ word: String) -> Bool {
    var board = board
    let m = board.count, n = board[0].count
    let word = Array(word)

    func dfs(_ i: Int, _ j: Int, _ k: Int) -> Bool {
        if k == word.count { return true }
        if i < 0 || i >= m || j < 0 || j >= n || board[i][j] != word[k] {
            return false
        }

        let temp = board[i][j]
        board[i][j] = "#"  // Mark visited

        let found = dfs(i+1, j, k+1) || dfs(i-1, j, k+1) ||
                    dfs(i, j+1, k+1) || dfs(i, j-1, k+1)

        board[i][j] = temp  // Backtrack
        return found
    }

    for i in 0..<m {
        for j in 0..<n {
            if dfs(i, j, 0) { return true }
        }
    }
    return false
}
